import React from "react";
import "./Brandslove.css";

const BrandsLove = () => {
  return (
    <div className="brands-love">
      <div className="max-width">
        <div className="brands-love-heading">rewards from brands you love.</div>
        <div className="brands-love-banner"></div>
        <div className="brands-love-content">
          <p>Get exclusive rewards and offers from the most loved brands. Enjoy discounts, cashback, and special deals just for you.</p>
        </div>
      </div>
    </div>
  );
};

export default BrandsLove;
